window.bookSummaryJSON = "<p>Gryff never knew he was the most powerful summoner in the world until a rogue monster attacked his village.</p> <p>Now, he's been recruited into the top magical academy, beautiful women are breaking down his dorm-room door, and the headmaster has big, big plans for him. Instead of summoners being maligned by society, Gryff is in a position to make them revered and honored.</p> <p>There's just one problem: The most powerful fire mage in the academy wants to protect the status quo and will do anything to stop him.</p> <p>This novel has harem elements.</p>"; 
